import React, {useState} from 'react';

import '../../style/LearnSet.css';


function FlashCard() {

    let wordSet = [
        {
            id: 1,
            part1: 'cat',
            part2: 'koshka'
        },
        {
            id: 2,
            part1: 'bog',
            part2: 'cobaka'
        }
    ]

    const [state, setState] = useState({text: 'something'})

    this.onClickButton1 = () => {
    setState({
        text: 'clicked 1'
    });
    }

    this.onClickButton2 = () => {
    setState({
        text: 'clicked 2'
    });
    }

    return (
        <div>
            <button onClick={this.onClickButton1}>
            Button 1
            </button>
            <button onClick={this.onClickButton2}>
            Button 2
            </button>
            <h1>{this.state.text}</h1>
        </div>
    )
}

export default FlashCard;
